import React from "react";
import Task from "./components/Task.jsx";
import { AiOutlinePlus } from 'react-icons/ai';


function App(){
  return(
    <>
      <div className="bg-white w-[85%]  flex flex-col md:w-[50%]  h-[80%]">
        <div className="text-center my-[10px]"><p className="font-bold  text-4xl text-teal-900 ">TODO LIST</p></div>
        <div className="flex px-[20px] justify-between my-[20px]">
          <input placeholder="Add Your New Todo" className="px-[16px] flex-[0.90] border border-gray-400"></input>
          <div onClick="" className="text-white text-2xl font-bold flex-[0.05] bg-teal-400 flex justify-center items-center rounded p-[6px] cursor-pointer hover:bg-teal-700">
            <AiOutlinePlus/>
          </div>
        </div>
        <div className="my-[30px] overflow-y-auto text-red-500 ">
          <Task/>
          <Task/>
          <Task/>
        </div>
      </div>
      
    </>
  )
}

export default App;
